"set_unlock_explain_1" : "    When enable configuration option, the maximum times of fail input and the locking time could be setted by users. 
    When disable configuration option, the system will use default setting. Password input will be locked after 5 failed attempts. 
    Input incorrect 5 times, lock one minute; 
    Input incorrect 5 times again, lock five minutes; 
    Input incorrect 5 times again, lock ten minutes; 
    Input incorrect 5 times again, lock thirty minutes; 
    Input incorrect 5 times again, lock sixty minutes; 
    Input incorrect 5 times again, lock sixty minutes; 
    Once input the correct password, re-count the error times."

"privacy_content_1_present" : "    When you use our scan function to activate tokens and obtain server-side information, we will save the corresponding token information and server-related information, and you can delete this information at any time. After you authorize and agree, we will access your camera and pictures to provide you with the activation token and the function of parsing server-side information. 

 In addition, in accordance with relevant laws, regulations and national standards, we may collect and use your personal information in the following situations without asking for your authorization and consent: 
 • Directly related to national security, national defense security and other national interests ;
 • Directly related to major public interests such as public safety, public health, and public knowledge; 
 • Directly related to criminal investigation, prosecution, trial, and execution of judgments; 
 • Out of safeguarding you or your personal Life, property, reputation and other major legitimate rights and interests, but it is difficult to obtain the consent of the person;
 • the personal information collected is disclosed to the public by you;
"
